import React from "react";

// Optionally import images at the top of the file if you have a fixed set
// import logoImage from '../images/logo.png';

function Headeris({
  klase = "d-flex align-items-center justify-content-between",
  stilius = {},
  logo = "logo.png", // The logo path can be passed as a prop if dynamic
  logo_plotis = 100, // Width of the logo
}) {
  // Construct the full path to the image
  const logoPath = require(`../images/${logo}`); // Use this if you want to pass a dynamic logo name

  return (
    <header className={klase} style={stilius}>
      <img
        src={logoPath} // Replace with `logoImage` if using a static import
        width={logo_plotis}
        height={logo_plotis}
        alt="Logo"
        style={{ maxWidth: "100%", height: "auto" }} // Responsive styling
      />
    </header>
  );
}

export default Headeris;
